import React from 'react';
import './App.scss';
import Container from '@material-ui/core/Container';
import InputBase from '@material-ui/core/InputBase';
import Divider from '@material-ui/core/Divider';
import IconButton from '@material-ui/core/IconButton';
import SearchIcon from '@material-ui/icons/Search';
class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  componentDidMount() {
  }
  render(){
    return ( 
      <div className = "App" >
      <div className="navbar">
        <Container fixed >
        < img class = "img-fluid"
        alt = "logo brand nobo noir"
        src = {require('./images/nobo-logo.png')} /> 
        </Container> 
      </div>

      <Container fixed className="content">
        <div className="content-search">
        <InputBase
        className='input'
        placeholder="Search Google Maps"
        inputProps={{ 'aria-label': 'search google maps' }}
      />
      <IconButton className='iconButton-custom' aria-label="search">
        <SearchIcon />
      </IconButton>
      <Divider className='divider' orientation="vertical" />
      <IconButton color="primary" className='iconButton-custom' aria-label="directions">
      </IconButton>
        </div>
      </Container>
      <div className="footer">
        <Container fixed className="footer-content" >
        < img class = "logo-footer"
        alt = "logo brand nobo blanc"
        src = {require('./images/nobo-logo-white.svg')} /> 
        <p>Test Technique Nobo</p>
        </Container> 
      </div>
      </div>
    );
  }

}

export default App;
